let EDIT_ID
const onEdit =eve=>{
   EDIT_ID = eve.closest('.card').id

   let EDIT_OBJ=MoviesArr.find(to=> to.MovieId===EDIT_ID)

   moviename.value= EDIT_OBJ.MovieName
  moviedescription.value=EDIT_OBJ.MovieDesc
  movieimg.value =EDIT_OBJ.MovieImg

movieaddbtn.classList.add("d-none")
movieUpdatedbtn.classList.remove("d-none")
  onModelShow()
}
 
const onRemove=eve=>{
  let confirmation=confirm("Are you sure , you want to Remove this Movie?")

  if(confirmation){
    let Remove_id= eve.closest(".card").id

    let Remove_obj= MoviesArr.findIndex(mo=>mo.MovieId===Remove_id)

    MoviesArr.splice(Remove_obj,1)

    eve.closest(".col-md-3").remove()
  }
}

let moviecardtemplating= ele=>{

  result=""

  ele.forEach(to=>{
    result+=`
     <div class="col-md-3 mb-5">
    <div class="card moviecard h-100" id="${to.MovieId}">
            <div class="card-header pb-0">
              <h2 class="m-0">${to.MovieName}</h2>
            </div>
            <div class="card-body body">
              <figure class="mb-0">
                <img
                  src="${to.MovieImg}"
                  alt="${to.MovieName}"
                  titile="${to.MovieName}"
                />
                 <figcaption>
                <p>
                <h3>${to.MovieName}</h3>
                 ${to.MovieDesc}
                </p>
              </figcaption>
              </figure>
             
            </div>
            <div class="card-footer d-flex justify-content-between">
              <button onclick="onEdit(this)" class="btn btn-success">Edit</button>
              <button onclick="onRemove(this)" class="btn btn-danger">Remove</button>
            </div>
          </div>
        </div>`
  })

  moviecardtemplte.innerHTML=result;
}
moviecardtemplating(MoviesArr)
const onModelShow=eve=>{
   backDrop.classList.add("active")
   moviemodel.classList.add("active")
}
const onHideModel=eve=>{
      backDrop.classList.remove("active")
   moviemodel.classList.remove("active")
}

const onMovieAdd=eve=>{

    eve.preventDefault()

    let movie_obj={
        MovieName:moviename.value,
        MovieDesc:moviedescription.value,
        MovieImg:movieimg.value,
        MovieId:uuid()
    }

    movieForm.reset(),
    MoviesArr.unshift(movie_obj)
    
    moviecardtemplating(MoviesArr)
onHideModel()
cl(MoviesArr)
}

const onmovieUpdate=eve=>{
  let Update_id =EDIT_ID

  let update_obj={
     MovieName:moviename.value,
        MovieDesc:moviedescription.value,
        MovieImg:movieimg.value,
        MovieId:Update_id
  }
 movieForm.reset()

  let getindex= MoviesArr.findIndex(mo=> mo.MovieId===Update_id)
   MoviesArr[getindex] = update_obj

   movieUpdatedbtn.classList.add("d-none")
   movieaddbtn.classList.remove("d-none")
    onHideModel()
       moviecardtemplating(MoviesArr)

  }


showmodelbtn.addEventListener("click",onModelShow)

closemoviemodelbtn.forEach(ele=>{
    ele.addEventListener("click",onHideModel)
})

movieForm.addEventListener("submit", onMovieAdd)
movieUpdatedbtn.addEventListener("click", onmovieUpdate)